  _globals['_SESSIONSERVICE'].methods_by_name['GetSession']._serialized_options = b'\222A\312\005\n\010Sessions\022\023Get session details\032\315\004Retrieves comprehensive details for a specific user session including authentication status, device information, and expiration timelines. Use this endpoint to fetch current session metadata for security audits, session validation, or to display session information in user account management interfaces. Returns all session properties including the user ID, authenticated organizations, device details with browser/OS information, IP address and geolocation, and all relevant timestamps (creation, last activity, idle expiration, absolute expiration, and actual expiration if applicable).JY\n\003200\022R\n&Successfully retrieved session details\022(\n&\032$.scalekit.v1.sessions.SessionDetails\202\265\030\002\030T\202\323\344\223\002\037\022\035/api/v1/sessions/{session_id}'
