  _globals['_SESSIONSERVICE'].methods_by_name['RevokeSession']._serialized_options = b'\222A\201\005\n\010Sessions\022\023Revoke user session\032\336\003Immediately invalidates a specific user session by session ID, setting its status to \'revoked\'. Once revoked, the session cannot be used for any future API requests or application access. Use this endpoint to implement session-level logout, force a user to reauthenticate on a specific device, or terminate suspicious sessions. The revocation is instantaneous and irreversible. Returns the revoked session details including the session ID, user ID, and the revocation timestamp.J\177\n\003200\022x\nESuccessfully revoked the session. Returns the revoked session details\022/\n-\032+.scalekit.v1.sessions.RevokeSessionResponse\202\265\030\002\030T\202\323\344\223\002&\"$/api/v1/sessions/{session_id}/revoke'
